  return (
    <Router>

      <Route exact path="/user">
        <h1>I am a user</h1>
      </Route>
      <Route exact path={ROUTES.HOME}>
        {/* <Home/> */}
        <h1>hlo</h1>
      </Route>
    </Router>
  );
}

export default App;
